//https://leetcode.com/problems/minimum-window-substring
class Solution {
public:
    string minWindow(string s, string t) {
        unordered_map<char, int> m;
        for(auto ch: t){
            m[ch]++;
        }

        int start = 0;
        int end = 0;
        unordered_set<char> visit;
        unordered_map<char, int> window;
        while(end < s.size()){
            if(m.count(s[end])){
                window[s[end]]++;
                if(window[s[end]] >= m[s[end]]){
                    visit.insert(s[end]);
                }
            }
            end++;
            if(visit.size() == m.size())
                break;
        }
        if(visit.size() != m.size())
            return "";
        int start_index = start;
        int end_index = end;
        while(start < end && end < s.size()){
            if(!m.count(s[start])){
                start++;
                if((end_index - start_index) > (end - start)){
                    end_index = end;
                    start_index = start;
                }
                continue;
            }else if(m.count(s[start]) && window[s[start]] > m[s[start]]){
                window[s[start]]--;
                start++;
                if((end_index - start_index) > (end - start)){
                    end_index = end;
                    start_index = start;
                }
                continue;
            }else if(m.count(s[end])){
                window[s[end]]++;
            }
            end++;
        }
        
        while(s.size() >= start + t.size()){
            if(!m.count(s[start])){
                start++;
                if((end_index - start_index) > (end - start)){
                    end_index = end;
                    start_index = start;
                }
            }else if(m.count(s[start]) && window[s[start]] > m[s[start]]){
                window[s[start]]--;
                start++;
                if((end_index - start_index) > (end - start)){
                    end_index = end;
                    start_index = start;
                }
            }else{
                break;
            }
        }

        return s.substr(start_index, end_index-start_index);
    }
};
